import React, { useState, useEffect } from 'react';
import {
    Box,
    TextField,
    Button,
    Typography,
    Paper,
    List,
    ListItem,
    CircularProgress,
    ListItemText,
} from '@mui/material';
import axios from '../utils/axiosConfig';

const Chat = () => {
    const [messages, setMessages] = useState([]);
    const [input, setInput] = useState('');
    const [isLoading, setIsLoading] = useState(false);

    // Supported commands list
    const supportedCommands = [
        { command: 'remove column <column_name>', example: 'Example: remove column Age' },
        { command: 'rename column <old_name> to <new_name>', example: 'Example: rename column Age to Years' },
        { command: 'filter rows where <condition>', example: 'Example: filter rows where Age > 25' },
    ];

    // Fetch welcome message on component mount
    useEffect(() => {
        const fetchWelcomeMessage = async () => {
            try {
                const response = await axios.get('/chat', {
                    headers: { Authorization: `Bearer ${localStorage.getItem('token')}` },
                });
                const { message } = response.data;
                setMessages([{ sender: 'system', text: message }]);
            } catch (error) {
                setMessages((prev) => [
                    ...prev,
                    { sender: 'system', text: 'Failed to fetch welcome message.' },
                ]);
            }
        };
        fetchWelcomeMessage();
    }, []);

    // Handle sending user input
    const handleSendMessage = async () => {
    if (!input.trim()) {
        setMessages((prev) => [
            ...prev,
            { sender: 'system', text: 'Please enter a valid command.' },
        ]);
        setInput('');
        return;
    }

    setIsLoading(true);

    try {
        const response = await axios.post(
            '/transform',
            { command: input },
            { headers: { Authorization: `Bearer ${localStorage.getItem('token')}` } }
        );

        const { message } = response.data;

        setMessages((prev) => [
            ...prev,
            { sender: 'user', text: input },
            { sender: 'ai', text: message }
        ]);
    } catch (error) {
        const errorMessage = error.response?.data?.message || 'Failed to apply transformation';

        setMessages((prev) => [
            ...prev,
            { sender: 'user', text: input },
            { sender: 'system', text: errorMessage },
        ]);
    } finally {
        setInput(''); // Clear input field after sending
        setIsLoading(false);
    }
};

// On Component Mount - Fetch Welcome Message
useEffect(() => {
    const fetchWelcomeMessage = async () => {
        try {
            const response = await axios.get('/chat', {
                headers: { Authorization: `Bearer ${localStorage.getItem('token')}` },
            });
            const { message } = response.data;

            setMessages([{ sender: 'system', text: message }]);
        } catch (error) {
            setMessages([{ sender: 'system', text: 'Failed to fetch welcome message.' }]);
        }
    };
    fetchWelcomeMessage();
}, []);

    return (
        <Box
            sx={{
                height: '100vh',
                display: 'flex',
                flexDirection: 'column',
                justifyContent: 'center',
                alignItems: 'center',
                backgroundColor: '#3E2723',
            }}
        >
            <Paper
                elevation={6}
                sx={{
                    width: '100%',
                    maxWidth: 800,
                    height: '80%',
                    display: 'flex',
                    flexDirection: 'column',
                    borderRadius: 2,
                    backgroundColor: '#D84315',
                    color: '#fff',
                }}
            >
                <Typography
                    variant="h5"
                    textAlign="center"
                    sx={{
                        padding: 2,
                        borderBottom: '1px solid #E64A19',
                        backgroundColor: '#BF360C',
                    }}
                >
                    Chat with Intelligent Service
                </Typography>
                <Box sx={{ flex: 1, overflowY: 'auto', padding: 2 }}>
                    <List>
                        {messages.map((message, index) => (
                            <ListItem
                                key={index}
                                sx={{
                                    justifyContent: message.sender === 'user' ? 'flex-end' : 'flex-start',
                                }}
                            >
                                <Paper
                                    elevation={3}
                                    sx={{
                                        padding: 1.5,
                                        maxWidth: '70%',
                                        borderRadius: '15px',
                                        backgroundColor: message.sender === 'user' ? '#FF7043' : '#F57C00',
                                        color: message.sender === 'user' ? '#fff' : '#000',
                                    }}
                                >
                                    {typeof message.text === 'string' ? (
                                        message.text
                                    ) : (
                                        <Box>{message.text}</Box>
                                    )}
                                </Paper>
                            </ListItem>
                        ))}
                    </List>
                </Box>
                <Box
                    sx={{
                        display: 'flex',
                        padding: 2,
                        backgroundColor: '#BF360C',
                        borderTop: '1px solid #E64A19',
                        alignItems: 'center',
                    }}
                >
                    <TextField
                        placeholder="Type a command... (e.g., 'Remove rows where column A > 5')"
                        fullWidth
                        value={input}
                        onChange={(e) => setInput(e.target.value)}
                        sx={{
                            backgroundColor: '#F57C00',
                            borderRadius: 1,
                            input: { color: '#fff' },
                        }}
                        disabled={isLoading}
                    />
                    <Button
                        variant="contained"
                        color="secondary"
                        onClick={handleSendMessage}
                        disabled={isLoading}
                        sx={{
                            marginLeft: 2,
                            textTransform: 'none',
                            backgroundColor: '#D84315',
                            '&:hover': { backgroundColor: '#BF360C' },
                        }}
                    >
                        {isLoading ? <CircularProgress size={24} color="inherit" /> : 'Send'}
                    </Button>
                </Box>
            </Paper>
        </Box>
    );
};

export default Chat;
